const root = ReactDOM.createRoot(document.getElementById("root"));

/* const rootElement = document.getElementById("root");
const root = createRoot(rootElement); */

root.render(
  <React.StrictMode>
    <Router>
      <App />
    </Router>
  </React.StrictMode>
);
